import React, { Fragment } from "react";
import Navbar from "./components/layout/Navbar";
import Landing from "./components/layout/Landing";

import "./App.css";

const App = () => (
  // Fragment is a ghost element, it won't show up in the DOM
  <Fragment>
    <Navbar />
    <Landing />
  </Fragment>
);

export default App;
